import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

ReactDOM.render(
  <>
    <h1>Prime Series</h1>
    <ul>
    <li>Mirzapur</li>
    <li>BADLAPUR</li>
    <li>PATALOK</li>
    </ul>
  </>,
  document.getElementById('root')
);
